import http from "./http-common";
class DataService {
  create() {
    //return http.get("/simulado", data);
    return http.post("/simulado", {
      firstName: 'Fred',
      lastName: 'Flintstone'
    })
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }

  retrieve(){
    return http.get("/");
  }

  teste(){
    return http.post("/teste");
  }
}
export default new DataService();
